
from .base import DBModel
from sqlalchemy import Column
from sqlalchemy import Text
from sqlalchemy import Integer
from sqlalchemy import String
from sqlalchemy import Boolean


class FIXED(DBModel):
    __tablename__ = 'FIXED'
    id = Column('id', Integer, primary_key=True)

    cve_id = Column('cve_id', String(length=20), index=True)
    fixer = Column('fixer', Text)
    fix_date = Column('fix_date', Text)
    patch_sources = Column('patch_sources', Text)
    is_abi_changed = Column('is_abi_changed', Boolean)
    gerrit_links = Column('gerrit_links', Text)
    upgraded_package = Column('upgraded_package', Text)
    verification_method = Column('verification_method', Text)
    verification_effect = Column('verification_effect', Text)
